static int is_gb2312(char *text, int text_length)
{
	int i = 0;
	if(text_length > 0){
		for(i = 0; i < text_length - 1; ++i){
			char *chr = &text[i];
			if( *chr >= 0xe0){
				return 0;
			}else if(*chr >= 0xa0){
				return 1;
			}
		}
	}
	return 0;
}

