int gb2312_to_utf8(bool zhT, char *textGB2312, char *result, int resultMax)
{
	char *pGB2312 = textGB2312;
	char *pUTF8 = result;
	CharCode *charatorBuf = NULL;
	int i= 0;

	if(zhT){
		charatorBuf = _charatorSortByGB2312T;
	}else{
		charatorBuf = _charatorSortByGB2312S;
	}
	if(is_gb2312(textGB2312, strlen(textGB2312))){	
		while(*pGB2312 != 0 && (result + resultMax - pUTF8) > 3){			
			if((*pGB2312) >= 0xa0){
				CharCode* cp = bsearch(pGB2312, _charatorSortByGB2312S, _charatorLengthS, sizeof(CharCode), gb2312_to_utf8_bsearch);
				if(cp != NULL){
					*pUTF8++ = cp->utf8.utf8_char[1];
					*pUTF8++ = cp->utf8.utf8_char[2];
					*pUTF8++ = cp->utf8.utf8_char[3];
					pGB2312 += 2;
				}else{
					*pUTF8++ = ' ';
					pGB2312++;
				}
			}else	{
				*pUTF8++ = *pGB2312;
				pGB2312++;
			}
		}
		*pUTF8 = 0;
		return 1;
	}else{
		return 0;
	}
}

static int utf8_to_gb2312_bsearch(const void *a, const void *b)
{
	unsigned int utf8_code = 0;
	utf8_code |= *(((unsigned char*)a)) << 8;
	utf8_code |= *(((unsigned char*)a)+1) << 16;
	utf8_code |= *(((unsigned char*)a)+2) << 24;
	return  utf8_code - ((CharCode*)b)->utf8.utf8_code;
}

int utf8_to_gb2312(char* _utf8, char *result, int resultMax)
{
	char* pu = _utf8;
	char* pg = result;
	
	while(*pu != 0 && (result + resultMax - pg) > 3)
	{
		if( ((*pu)&0x80) == 0x80 )
		{
			CharCode* cp = bsearch(pu, _charatorSortByUTF8S, _charatorLengthS, sizeof(CharCode), utf8_to_gb2312_bsearch);
			if(cp != NULL)
			{
				*pg = cp->gb2312.gb2312_char[0];
				pg++;
				*pg = cp->gb2312.gb2312_char[1];
				pg++;
				pu += 3;
			}
			else
			{
				*pg = ' ';
				pg++;
				pu++;
			}
		}
		else
		{
			*pg = *pu;
			pg++;
			pu++;
		}
	}
	*pg = 0;
	return 0;
}


