int gb2312_to_utf8_nprintf(char *utf8_buf, int max_sz, const char *fmt, ...)
{
	int str_len = 0;
	char *gb2312_buf = (char*)calloc(max_sz, 1);
	if(gb2312_buf){
		va_list ap;
		va_start(ap, fmt);
		str_len = vsnprintf(gb2312_buf, max_sz,fmt,ap);
		va_end(ap);
		gb2312_to_utf8(false, gb2312_buf,utf8_buf, max_sz);
	}
	return str_len;
}



